"original": |2-
     The Printer returns all of the Jobs up to the number specified by the
     "limit" attribute that match the criteria as defined by the attribute
     values supplied by the Client in the request.  It is possible that no
     Jobs are returned, since there can literally be no Jobs at the
     Printer or there can be no Jobs that match the criteria supplied by
     the Client.  If the Client requests any Job attributes at all, there
     is a set of Job Attributes returned for each Job.
"fixed": |-
  The Printer returns all of the Jobs up to the number specified by the "limit" attribute that match the criteria as defined by the attribute values supplied by the Client in the request.  It is possible that no Jobs are returned, since there can literally be no Jobs at the Printer or there can be no Jobs that match the criteria supplied by the Client.  If the Client requests any Job attributes at all, there is a set of Job Attributes returned for each Job.
"ko": |-
  프린터는 요청에서 클라이언트가 제공한 속성 값에 의해 정의된 기준과 일치하는 "제한" 속성에 지정된 수까지 모든 작업을 반환합니다. 말 그대로 프린터에 작업이 없거나 클라이언트가 제공한 기준과 일치하는 작업이 없을 수 있으므로 작업이 반환되지 않을 수 있습니다. 클라이언트가 작업 속성을 요청하는 경우 각 작업에 대해 작업 속성 집합이 반환됩니다.
